<style id='acf-about-style-inline-css' type='text/css'>
.about-side-links {
    text-decoration: none;
}

.about-side-links-bg {
    transition: all .25s ease-in-out;
}

.about-side-links:hover .about-side-links-bg {
    background: var(--accent-secondary) !important;
}
</style>
<style id='acf-popup-style-inline-css' type='text/css'>
.open-modal {
    cursor: pointer;
}

.modal-content {
    top: 0;
    left: 0;
    border: none;
    opacity: 0;
    transition: all 0.25s ease-in-out;
    pointer-events: none;
    background: transparent;
}

.modal-content.activate-modal {
    opacity: 1 !important;
    pointer-events: all;
}

.bg-overlay {
    position: absolute;
    top: 0;
    right: 0;
    bottom: 0;
    left: 0;
    background: rgba(0, 0, 0, 0.5);
}

.bg-content {
    width: 95%;
    height: 95%;
    background: white;
    position: relative;
    margin: auto;
    /* padding: 50px 25px; */
    overflow: scroll;
}

.modal-content .close {
    position: absolute;
    top: 25px;
    right: 25px;
    background: white;
    height: 25px;
    width: 25px;
    display: flex;
    align-items: center;
    justify-content: center;
    border-radius: 50%;
    cursor: pointer;
    transition: all .25s ease-in-out;
}

.modal-content .close:hover {
    background: black;
    color: white;
}
</style>
